import React from 'react';
import ReactDOM from 'react-dom/client'


const AppHeader = () => {

}


const TodoList = () => {
  return(
  <ul>
    <li>Learn React</li>
    <li>Build Awesome App</li>
  </ul>
  )
}


const el = (
  <div>
    <h1>My ToDo List</h1>
    <input placeholder="search" />
    <TodoList />
  </div>
)

const mainBlock = document.getElementById('root');
const root = ReactDOM.createRoot(mainBlock);
root.render(el)
